import { GlobalStyle } from './components/Cover/Cover.Style';

import Main from './components/Main';

import './App.css';

function App() {
  return (
    <React.Fragment>

<BrowserRouter >
                <div className='hoss'>
                  <GlobalStyle whiteColor />
                    <Main/>
                </div>
                </BrowserRouter>
</React.Fragment>

  );
}

export default App;
